        SET var_numeroUnico="";
		IF  LENGTH(var_rfc) >= 4 THEN
            SET var_numeroUnico = SUBSTRING(var_rfc, 1, 4);
        END IF;
        SET var_numeroUnico = CONCAT(var_numeroUnico, CAST(UNIX_TIMESTAMP() AS CHAR));
        
        -- Finalmente, insertamos en la tabla cliente:
